    matrix_map    varchar not null,
    name          varchar,
    description   varchar,
    entry_city_id varchar,
    create_time   timestamp,
    update_time   timestamp
);

alter table t_world
    owner to postgres;

create index t_world_id_entry_city_id_index
    on t_world (id, entry_city_id);

